import React, { Component } from 'react'

export class Dashboard extends Component {
    constructor(){
        super()
    }


    render() {
        const { pp } = this.localStorage.getItem('profile_pic_exists');
        return (
            <div>
                { pp }
            </div>
        )
    }
}

export default Dashboard
